INSERT INTO `reb` VALUES ('1889', '商河县鑫隆房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8e1801b2-278d-4140-a635-beda897c2ebe.shtml', '', '012786', '尚开义', '商河县武夷山御泉名城A区7号楼1单元401室', '053182541680', '', '3000 万元', '民营企业', '商河县鑫隆房地产开发有限公司是2010年投资成立的一家房地产开发企业，具有房地产开发资质，公司注册资金1000万元，现有在职职工38人，其中中级以上职称20人。公司按照现代企业制度的管理模式，遵循有限公司制度的运作方式，下设人力资源部、企划营销部、工程部、财务部，在总经理的领导下，通力合作，相互协调，初步形成了一个上进、勇于开拓的企业团队。公司始终坚持以市场为导向、开发为重点，经营为龙头，质量为根本的开发理念和经营方针，切实转变观念，解放思想，紧紧围绕市场狠抓经营，强化管理，树立责任感、认识危机感；不断留意和观察房地产市场行情，积极寻求探索与市场机制相适应的经营策略和经营方针，走品牌化之路。 公司竭诚希望与社会各界携手并进，共谋发展，同创美好未来。', '商河县鑫隆房地产开发有限公司null尚开义商河县武夷山御泉名城A区7号楼1单元401室0531825416803000 万元民营企业商河县鑫隆房地产开发有限公司是2010年投资成立的一家房地产开发企业，具有房地产开发资质，公司注册资金1000万元，现有在职职工38人，其中中级以上职称20人。公司按照现代企业制度的管理模式，遵循有限公司制度的运作方式，下设人力资源部、企划营销部、工程部、财务部，在总经理的领导下，通力合作，相互协调，初步形成了一个上进、勇于开拓的企业团队。公司始终坚持以市场为导向、开发为重点，经营为龙头，质量为根本的开发理念和经营方针，切实转变观念，解放思想，紧紧围绕市场狠抓经营，强化管理，树立责任感、认识危机感；不断留意和观察房地产市场行情，积极寻求探索与市场机制相适应的经营策略和经营方针，走品牌化之路。 公司竭诚希望与社会各界携手并进，共谋发展，同创美好未来。');
INSERT INTO `reb` VALUES ('1890', '济南建邦置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/915c802f-f227-4cec-853d-e5161a90b0c4.shtml', '', '012786', '陈志承', '济南市长清区海棠路5555号', '83186500', 'qfsunboy@126.com', '8000 万元', '国有企业', '', '2济南建邦置业有限公司null陈志承济南市长清区海棠路5555号83186500qfsunboy@126.com8000 万元国有企业');
INSERT INTO `reb` VALUES ('1891', '山东福创置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a073b566-383c-4cc7-a907-f024eed22972.shtml', '', '012482', '吴锡琛', '山东省章丘市明水经济开发区办公大楼6楼618室', '83227711', '53515826@qq.com', '888.88 万元', '中外合资经营企业', '山东福创置业有限公司是福泰集团发展有限公司响应山东省政府发展济南大城市框架的号召，在济南章丘市投资成立的一家中外合资企业。本公司在章丘市的注册资本为888.88万美元，主要从事房地产开发与经营及商业服务设施的建设为经营。', '山东福创置业有限公司null吴锡琛山东省章丘市明水经济开发区办公大楼6楼618室8322771153515826@qq.com888.88 万元中外合资经营企业山东福创置业有限公司是福泰集团发展有限公司响应山东省政府发展济南大城市框架的号召，在济南章丘市投资成立的一家中外合资企业。本公司在章丘市的注册资本为888.88万美元，主要从事房地产开发与经营及商业服务设施的建设为经营。');
INSERT INTO `reb` VALUES ('1892', '银丰地产集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/867ddef5-04d7-4f7b-9671-13edb81cd90a.shtml', '', '012225', '刘旭', '济南市市中区历阳大街六号银丰大厦', '89019777', '345074490@qq.com', '68000 万元', '民营企业', '济南银丰房地产开发有限公司成立于2001年4月，注册资本9500万元，具房地产开发企业三级资质。 公司实行董事会领导下的总经理负责制，目前设立综合管理部、计划财务部、合约审计部、开发部、设计部、工程管理部、材料采购部、营销策划部等部门。现有经营管理人员14人，具中、高级职称的专业技术人员29人。公司组织机构健全，分工明确，层次分明，构建了一套科学的经营管理系统，企业运作高效有序。在以人为本的思想指导下，公司确立了“诚信做人、认真做事、张弛有度、开拓进取”的企业理念。在公司文化建设上，以打造一支能征善战的优秀团队为目标，点燃激情，激励斗志，不断增强企业的凝聚力，培育团队精神。', '银丰地产集团有限公司null刘旭济南市市中区历阳大街六号银丰大厦89019777345074490@qq.com68000 万元民营企业济南银丰房地产开发有限公司成立于2001年4月，注册资本9500万元，具房地产开发企业三级资质。 公司实行董事会领导下的总经理负责制，目前设立综合管理部、计划财务部、合约审计部、开发部、设计部、工程管理部、材料采购部、营销策划部等部门。现有经营管理人员14人，具中、高级职称的专业技术人员29人。公司组织机构健全，分工明确，层次分明，构建了一套科学的经营管理系统，企业运作高效有序。在以人为本的思想指导下，公司确立了“诚信做人、认真做事、张弛有度、开拓进取”的企业理念。在公司文化建设上，以打造一支能征善战的优秀团队为目标，点燃激情，激励斗志，不断增强企业的凝聚力，培育团队精神。');
INSERT INTO `reb` VALUES ('1893', '济南铁路房产建设集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c0c71cd0-671f-4b76-bd38-d2742dd8cfcc.shtml', '', '012833', '孙向阳', '济南市天桥区车站街30号', '82422303', 'yzfdckfzz@163.com', '26737.5 万元', '国有企业', '企业简介： 我公司成立于1993年1月1日，原企业名称为：济南铁路局房地产开发公司，2006年11月经济南市工商行政管理局核准更名为：济南铁路房产建设集团有限公司。注册地址：济南市天桥区车站街30号，注册资本：1800万元整。公司类型：法人独资的有限责任公司。法人代表：法建堂。经营范围：房地产开发，房屋建筑物维修，建筑工程施工，土石方施工，园林绿化，制冷供暖、压力管道维修，机电设备安装；铝、塑钢门窗、涂料加工生产；物业管理，房屋信息中介；建筑设计。 我公司是按照济南铁路局、路局党委关于加快辅业发展的总体要求，为加快职工住房建设，稳步推进房地产业发展，经路局党政联席会议研究决定，组建济南铁路房产建设集团有限公司（济南铁路局职工住宅建设指挥部）。公司是全局7个房建单位，济南铁路局建设项目管理中心以及改制前“济南铁路分局建设项目管理中心”所属房建部门的上级主管单位。公司现有机关职工38人，其中公司领导7人，内部管理机构为25人，公司内部管理机构设置：综合部、计划财务部、人力资源部、安全质量部、经营开发部、党群工作部、行政检察部、技术设备部。主要负责济南铁路局住宅建设和房地产开发，承担着全局职工住宅建设的实施任务。', '济南铁路房产建设集团有限公司null孙向阳济南市天桥区车站街30号82422303yzfdckfzz@163.com26737.5 万元国有企业企业简介： 我公司成立于1993年1月1日，原企业名称为：济南铁路局房地产开发公司，2006年11月经济南市工商行政管理局核准更名为：济南铁路房产建设集团有限公司。注册地址：济南市天桥区车站街30号，注册资本：1800万元整。公司类型：法人独资的有限责任公司。法人代表：法建堂。经营范围：房地产开发，房屋建筑物维修，建筑工程施工，土石方施工，园林绿化，制冷供暖、压力管道维修，机电设备安装；铝、塑钢门窗、涂料加工生产；物业管理，房屋信息中介；建筑设计。 我公司是按照济南铁路局、路局党委关于加快辅业发展的总体要求，为加快职工住房建设，稳步推进房地产业发展，经路局党政联席会议研究决定，组建济南铁路房产建设集团有限公司（济南铁路局职工住宅建设指挥部）。公司是全局7个房建单位，济南铁路局建设项目管理中心以及改制前“济南铁路分局建设项目管理中心”所属房建部门的上级主管单位。公司现有机关职工38人，其中公司领导7人，内部管理机构为25人，公司内部管理机构设置：综合部、计划财务部、人力资源部、安全质量部、经营开发部、党群工作部、行政检察部、技术设备部。主要负责济南铁路局住宅建设和房地产开发，承担着全局职工住宅建设的实施任务。');
INSERT INTO `reb` VALUES ('1894', '济南蓝石田源置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a1f6da0f-f007-4b80-871a-d6f847511912.shtml', '', '012736', '陈敬伟', '经十西路2999号大溪地花园入口公建', '82677773', 'lszhywb@163.com', '10000 万元', '民营企业', '济南蓝石田源置业有限公司成立于2006年6月，公司注册资金2000万元，目前公司已经通过招牌挂取得275亩土地的开发使用权。', '济南蓝石田源置业有限公司null陈敬伟经十西路2999号大溪地花园入口公建82677773lszhywb@163.com10000 万元民营企业济南蓝石田源置业有限公司成立于2006年6月，公司注册资金2000万元，目前公司已经通过招牌挂取得275亩土地的开发使用权。');
INSERT INTO `reb` VALUES ('1895', '山东中润置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d8e57396-61c9-4435-9576-066fba61b41b.shtml', '', '002315', '马庆军', '济南市历下区经十路12111号中润世纪中心1号楼', '88196601', '', '5000 万元', '民营企业', '1996年4月 成立山东中润装饰防腐工程有限公司 1999年12月 更名为山东中润置业有限公司 1997年5月-2000年4月 开发完成中润裕华园小区 1998年1月-2000年12月 开发完成中润富华园小区 1999年1月-2000年12月 开发完成中润文东裕华园小区 2001年10月-2003年12月 开发完成中润世纪城一期 2004年1月-今 开发中润世纪城二期 累计开发22.4万平方米，完成投资6.6亿元 山东中润置业有限公司是一家具有一级开发资质的房地产开发企业，先后开发了“中润裕华园”“中润富华园”“文东裕华园”等高尚社区，销售率100％，正在开发建设的“中润世纪城”项目，充分展现了公司“诚信经营，服务创新”的经营理年。 公司先后被评为\"济南市十佳房地产开发企业\"“济南市先进民营企业”“济南市纳税明星企业”等荣誉称号', '山东中润置业有限公司null马庆军济南市历下区经十路12111号中润世纪中心1号楼881966015000 万元民营企业1996年4月 成立山东中润装饰防腐工程有限公司 1999年12月 更名为山东中润置业有限公司 1997年5月-2000年4月 开发完成中润裕华园小区 1998年1月-2000年12月 开发完成中润富华园小区 1999年1月-2000年12月 开发完成中润文东裕华园小区 2001年10月-2003年12月 开发完成中润世纪城一期 2004年1月-今 开发中润世纪城二期 累计开发22.4万平方米，完成投资6.6亿元 山东中润置业有限公司是一家具有一级开发资质的房地产开发企业，先后开发了“中润裕华园”“中润富华园”“文东裕华园”等高尚社区，销售率100％，正在开发建设的“中润世纪城”项目，充分展现了公司“诚信经营，服务创新”的经营理年。 公司先后被评为\"济南市十佳房地产开发企业\"“济南市先进民营企业”“济南市纳税明星企业”等荣誉称号');
INSERT INTO `reb` VALUES ('1896', '济南华凯源置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a7959ff7-ec14-4d51-97dd-45381807e41b.shtml', '', '012289', '王金忠', '济阳县济北开发区龙海私营园龙海路东侧海天街北侧办公楼二楼', '84232158', '15866677351@126.com', '5500 万元', '民营企业', '企业简介 济南华凯源置业有限公司成立于2002年5月，是集房地产开发、建材经营、公民建筑工程施工、地基基础工程施工的等综合性企业，房地产开发资质贰级，注册资金5500万元，具有年开发十万平方米能力，该公司人员63人，下设财务部、营销部、工程技术部、核算部及行政办公室5个部门。 先后开发完成了济南济北私营园、济北新世纪商贸城、华宇舜苑小区、乐陵富贵华府住宅小区、济阳万鑫舜花园、美凯龙住宅小区、金色家园住宅小区、济阳盛世瑞城小区、运河鑫城住宅小区等项目，完成销售额达9.618亿元；公司投资代建了济阳劳动就业培训中心、民政局星光之家综合楼、中国农村信用社济阳分社写字楼、福建达利食品有限公司济南分公司、新阳煤矿生活区住宅工程等工程，累计投资达5.16亿元。在建的开发项目有禹城市辛寨梁河社区、平原王庙后王明社区、德州运河鑫城住宅小区、鑫星国际商业写字间项目。 　　　公司成立以来一直遵照“惠民筑业、卓越高效”的企业精神，秉承“关注顾客、开拓进取、铸造精品、诚信为本”的质量方针，作风稳健，信誉卓著，公司连续三年被评为“市级重合同守信誉”企业，合同履行率99%，商品房销售满意率98%以上. TEC.0531---84232158 住址:济北开发区开元大街龙海路南段东侧', '济南华凯源置业有限公司null王金忠济阳县济北开发区龙海私营园龙海路东侧海天街北侧办公楼二楼8423215815866677351@126.com5500 万元民营企业企业简介 济南华凯源置业有限公司成立于2002年5月，是集房地产开发、建材经营、公民建筑工程施工、地基基础工程施工的等综合性企业，房地产开发资质贰级，注册资金5500万元，具有年开发十万平方米能力，该公司人员63人，下设财务部、营销部、工程技术部、核算部及行政办公室5个部门。 先后开发完成了济南济北私营园、济北新世纪商贸城、华宇舜苑小区、乐陵富贵华府住宅小区、济阳万鑫舜花园、美凯龙住宅小区、金色家园住宅小区、济阳盛世瑞城小区、运河鑫城住宅小区等项目，完成销售额达9.618亿元；公司投资代建了济阳劳动就业培训中心、民政局星光之家综合楼、中国农村信用社济阳分社写字楼、福建达利食品有限公司济南分公司、新阳煤矿生活区住宅工程等工程，累计投资达5.16亿元。在建的开发项目有禹城市辛寨梁河社区、平原王庙后王明社区、德州运河鑫城住宅小区、鑫星国际商业写字间项目。 　　　公司成立以来一直遵照“惠民筑业、卓越高效”的企业精神，秉承“关注顾客、开拓进取、铸造精品、诚信为本”的质量方针，作风稳健，信誉卓著，公司连续三年被评为“市级重合同守信誉”企业，合同履行率99%，商品房销售满意率98%以上. TEC.0531---84232158 住址:济北开发区开元大街龙海路南段东侧');
INSERT INTO `reb` VALUES ('1897', '山东金羚置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/81a9b96e-ddef-4733-b5e0-634863ef3cd2.shtml', '', '012117', '杨金峰', '济南市槐荫区南辛庄西路50号', '82919777', 'sdjlzy@163.com', '3000 万元', '国有企业', '山东金羚置业有限公司隶属于山东金羚集团。山东金羚集团是一家集毛纺、药业、房地产、航运、国际贸易和餐饮服务为一体的综合性集团公司。公司是在始建于1995年的山东金羚毛纺有限公司的基础上发展而来的，自创建以来，集团以创建一流的公司为抱负，基业长青为使命，本着以人为本，积极进取，开拓创新的理念不断壮大，凭借清晰的经营理念和浓郁鲜明的企业文化，精心打造具有自身特色的优秀品牌企业。经过多年的努力拼搏，已成为具有相当规模的产权多元化、经营多角化、投资多方位的集团公司，现拥有山东金羚毛纺有限公司，山东天顺药业股份有限公司，山东金羚置业有限公司、山东金羚置业（青岛）有限公司、山东金羚置业无棣分公司，山东金羚置业阳信分公司，上海硕今船务有限公司等企业，分布在滨州、济南、青岛、上海等地。集团现有员工1000多人，资产近10亿元，年实现利税近亿元。', '山东金羚置业有限公司null杨金峰济南市槐荫区南辛庄西路50号82919777sdjlzy@163.com3000 万元国有企业山东金羚置业有限公司隶属于山东金羚集团。山东金羚集团是一家集毛纺、药业、房地产、航运、国际贸易和餐饮服务为一体的综合性集团公司。公司是在始建于1995年的山东金羚毛纺有限公司的基础上发展而来的，自创建以来，集团以创建一流的公司为抱负，基业长青为使命，本着以人为本，积极进取，开拓创新的理念不断壮大，凭借清晰的经营理念和浓郁鲜明的企业文化，精心打造具有自身特色的优秀品牌企业。经过多年的努力拼搏，已成为具有相当规模的产权多元化、经营多角化、投资多方位的集团公司，现拥有山东金羚毛纺有限公司，山东天顺药业股份有限公司，山东金羚置业有限公司、山东金羚置业（青岛）有限公司、山东金羚置业无棣分公司，山东金羚置业阳信分公司，上海硕今船务有限公司等企业，分布在滨州、济南、青岛、上海等地。集团现有员工1000多人，资产近10亿元，年实现利税近亿元。');
INSERT INTO `reb` VALUES ('1898', '德州市鲁班房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/f96724fb-d1cd-447c-9906-bf56e579a71e.shtml', '', '132094', '甄宗杰', '济南市历下区旅游路26188号', '82677277', '958743038@qq.com', '3000 万元', '国有企业', '德州市鲁班房地产开发有限公司成立于2002年10月29日，隶属于德州市公路管理局，是一家集房地产开发、物业管理、建材销售、房地产业务咨询等为一体的综合型企业。公司注册资本3000万元，属房产开发二级资质。公司先后获得德州市房地产十强企业、十佳诚信房地产企业，消费者满意单位、重信用守合同企业等称号。公司拥有一支高素质、高效率的专业人才队伍，现有员工60余人，其中本科以上学历占70%，中、高级职称30多人。公司自02年成立以来，在德州市公路局领导的大力支持下，取得了长足发展。先后开发了“尚东-公路小区”、“鲁班御景园”、“鲁班紫麟阁”等住宅项目。', '德州市鲁班房地产开发有限公司null甄宗杰济南市历下区旅游路26188号82677277958743038@qq.com3000 万元国有企业德州市鲁班房地产开发有限公司成立于2002年10月29日，隶属于德州市公路管理局，是一家集房地产开发、物业管理、建材销售、房地产业务咨询等为一体的综合型企业。公司注册资本3000万元，属房产开发二级资质。公司先后获得德州市房地产十强企业、十佳诚信房地产企业，消费者满意单位、重信用守合同企业等称号。公司拥有一支高素质、高效率的专业人才队伍，现有员工60余人，其中本科以上学历占70%，中、高级职称30多人。公司自02年成立以来，在德州市公路局领导的大力支持下，取得了长足发展。先后开发了“尚东-公路小区”、“鲁班御景园”、“鲁班紫麟阁”等住宅项目。');
INSERT INTO `reb` VALUES ('1899', '山东茗筑世家置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/df936606-3fe7-4588-8326-625d3505ca5d.shtml', '', '012398', '杨星', '浪潮路1036号浪潮科技园s06号楼北6楼', '86133238', '754545303@qq.com', '10000 万元', '民营企业', '济南浪潮置业有限公司成立于2003年4月，公司经营范围包括房地产开发及物业管理、高新技术产业及房地产投资等。于2004年7月注册资金增至四亿元人民币。增资后的浪潮只有公司还将负责浪潮产业基地等的建设。 公司现有人员22名，其中工程技术及财务管理人员12人，高级工程师2名、中级工程师3名、助理工程师5名、会计师1名、造价工程1名。 自成立以来，公司致力于以人性化和人文的角度去开发项目。“做实齐鲁，构筑全中国，走向国际化”是浪潮置业所坚持的战略；“人本、诚信、卓越”的理念是浪潮品牌的核心；“科学管理，创建精品，以人为本，优质服务”始终是公司坚持的质量方针。 济南浪潮置业公司将坚持面向社会、服务社会的宗旨，不断追求卓越，凭借实力和诚信汇报社会，与广大客户及员工携手共创美好未来，为济南房地产的发展贡献力量。', '山东茗筑世家置业有限公司null杨星浪潮路1036号浪潮科技园s06号楼北6楼86133238754545303@qq.com10000 万元民营企业济南浪潮置业有限公司成立于2003年4月，公司经营范围包括房地产开发及物业管理、高新技术产业及房地产投资等。于2004年7月注册资金增至四亿元人民币。增资后的浪潮只有公司还将负责浪潮产业基地等的建设。 公司现有人员22名，其中工程技术及财务管理人员12人，高级工程师2名、中级工程师3名、助理工程师5名、会计师1名、造价工程1名。 自成立以来，公司致力于以人性化和人文的角度去开发项目。“做实齐鲁，构筑全中国，走向国际化”是浪潮置业所坚持的战略；“人本、诚信、卓越”的理念是浪潮品牌的核心；“科学管理，创建精品，以人为本，优质服务”始终是公司坚持的质量方针。 济南浪潮置业公司将坚持面向社会、服务社会的宗旨，不断追求卓越，凭借实力和诚信汇报社会，与广大客户及员工携手共创美好未来，为济南房地产的发展贡献力量。');
